export const compareData = (apiData, userData, type) => {
  const fieldsToCompare = [
    { api: type === "NIN" ? "firstname" : "firstName", user: "firstname" },
    { api: type === "NIN" ? "surname" : "lastName", user: "surname" },
  ];
  const mismatches = [];

  fieldsToCompare.forEach((field) => {
    let apiValue = apiData[field.api];
    let userValue = userData[field.user];

    if (
      apiValue &&
      userValue &&
      apiValue.toLowerCase() !== userValue.toLowerCase()
    ) {
      mismatches.push(field.user);
    }
  });

  return {
    isMatch: mismatches.length === 0,
    mismatches,
  };
};

